/* Some useful functions */

/* standard rolling counter */
static int
RollCount(
    unsigned int MsgId,
    int          CtrVal,
    int          Min,
    int          Max,
    int          Incr)
{
    CtrVal += Incr;
    if (CtrVal > Max)
	CtrVal = Min;
    else if (CtrVal < Min)
	CtrVal = Max;

    return CtrVal;
}


