/* calculates simple 4 Bit CRC */
static unsigned char
GetCRC4(
    unsigned char *Data,
    int           Len,
    unsigned int  StartVal)
{
    unsigned int s = StartVal;
    int          i;

    for(i=0; i<Len; i++)
	s += (Data[i]&15) + (Data[i]>>4);

    return (~s) & 15;
}


/* calculates simple 8 Bit CRC */
static unsigned char
GetCRC8(
    unsigned char *Data,
    int           Len,
    unsigned int  StartVal)
{
    unsigned int s = StartVal;
    int          i;

    for(i=0; i<Len; i++)
	s += Data[i];

    return ((s >> 8) + (s & 0xff)) & 0xff;
}


