/*
** PRIVATE_CAN_User_RxHookData ()
** - called by function PRIVATE_CAN_RxHook() / PRIVATE_CAN_RxHookFD()
** - in realtime context
*/

static int
PRIVATE_CAN_User_RxHookData(
    unsigned int       MsgId,
    unsigned int       IDE,
    unsigned int       FrameLen,
    unsigned char      *Data,
    const unsigned int CycleNo,
    int                Part)
{
    switch (MsgId|(IDE<<31)) {
    /* ECU AP_HMI */
    case PRIVATE_CAN_APHMIOut1_ID: {	/* CAN Msg 0x4a5 (APHMIOut1) */
	switch (Part) {
	case PRIVATE_CAN_PRE_DECODE:
	    break;
	case PRIVATE_CAN_POST_DECODE:
	    break;
	}
	return 0;
    }
    case PRIVATE_CAN_APHMIOut2_ID: {	/* CAN Msg 0x4ac (APHMIOut2) */
	switch (Part) {
	case PRIVATE_CAN_PRE_DECODE:
	    break;
	case PRIVATE_CAN_POST_DECODE:
	    break;
	}
	return 0;
    }
    case PRIVATE_CAN_APHMIOut3_ID: {	/* CAN Msg 0x4ad (APHMIOut3) */
	switch (Part) {
	case PRIVATE_CAN_PRE_DECODE:
	    break;
	case PRIVATE_CAN_POST_DECODE:
	    break;
	}
	return 0;
    }
    case PRIVATE_CAN_APHMIOut4_ID: {	/* CAN Msg 0x4ae (APHMIOut4) */
	switch (Part) {
	case PRIVATE_CAN_PRE_DECODE:
	    break;
	case PRIVATE_CAN_POST_DECODE:
	    break;
	}
	return 0;
    }

    default:
	break;
    }

    return -1;
}


/*
** PRIVATE_CAN_User_RxHook () / PRIVATE_CAN_User_RxHookFD ()
**
** User part of PRIVATE_CAN_Recv() / PRIVATE_CAN_RecvFD()
** - manipulations of received CAN messages
** - assignment of CAN signal values to Model variables
**
** call:
** - called twice by function PRIVATE_CAN_Recv() / PRIVATE_CAN_RecvFD()
**   1.) before decoding data bytes of CAN message (Part = IO_CAN_PRE_DECODE)
**       + allows manipulation of raw data bytes
**       + return value controls, if message will be discarded:
**         < 0  discard message
**         0    keep message, message not modified
**         > 0  keep message, message was modified (manipulated)
**   2.) after decoding data bytes of CAN message (Part = IO_CAN_POST_DECODE)
**       + allows calculations based on newly updated I/O variables
** - in realtime context
*/

static int
PRIVATE_CAN_User_RxHook(
    struct CAN_Msg     *Msg,
    const unsigned int CycleNo,
    int                Part)
{
    return PRIVATE_CAN_User_RxHookData(
		Msg->MsgId, Msg->FrameFmt, Msg->FrameLen, Msg->Data, CycleNo, Part);
}


static int
PRIVATE_CAN_User_RxHookFD(
    struct CANFD_Msg   *Msg,
    const unsigned int CycleNo,
    int                Part)
{
    int FrameLen = PRIVATE_CAN_DLC2Bytes(Msg->DLC);

    if (FrameLen < 0)
	return -1;

    return PRIVATE_CAN_User_RxHookData(
		Msg->MsgId, Msg->IDE, FrameLen, Msg->Data, CycleNo, Part);
}


