/*
** PRIVATE_CAN_User_TxHook () / PRIVATE_CAN_User_TxHookFD ()
**
** User part of PRIVATE_CAN_SendMsg()
** - assignment of Model values to CAN signal variables
** - manipulations of transmitted CAN messages
**
** call:
** - called twice by function PRIVATE_CAN_SendMsg()
**   1.) before encoding data bytes of CAN message (Part = IO_CAN_PRE_ENCODE)
**       + allows calculations specific to CAN signals of current message
**   2.) after encoding data bytes of CAN message (Part = IO_CAN_POST_ENCODE)
**       + allows manipulation of raw data bytes
**       + return value controls, if message will be discarded:
**         < 0  discard message
**         0    send message, message not modified
**         > 0  send message, message was modified (manipulated)
** - in realtime context
*/

static int
PRIVATE_CAN_User_TxHook(
    struct CAN_Msg     *Msg,
    const unsigned int CycleNo,
    int                Part)
{
    return PRIVATE_CAN_User_TxHookData(
		Msg->MsgId, Msg->FrameFmt, Msg->FrameLen, Msg->Data, CycleNo, Part);
}


static int
PRIVATE_CAN_User_TxHookFD(
    struct CANFD_Msg   *Msg,
    const unsigned int CycleNo,
    int                Part)
{
    int FrameLen = PRIVATE_CAN_DLC2Bytes(Msg->DLC);

    if (FrameLen < 0)
	return -1;

    return PRIVATE_CAN_User_TxHookData(
		Msg->MsgId, Msg->IDE, FrameLen, Msg->Data, CycleNo, Part);
}
    
